const proxy = require('http-proxy-middleware');

module.exports = function (app) {
    app.use('/ping', proxy({
        target: 'http://localhost:8080/',
        changeOrigin: true,
    }));

    app.use('/verifyEmail', proxy({
        target: 'http://localhost:8080/verifyEmail',
        changeOrigin: true,
    }));
};
